import React, { useState, Fragment } from 'react'

 


 


const TitleTable = (props) => {
    console.log(props.titles)
    return ( 

      <Fragment>
      
      
        {
        
            props.titles.map((title, index) =>
            <p key={index}>{index}</p>)
    }
    
    </Fragment>
        

        


     );

}
 


 
export default Indexn;
